import React, {useState, useEffect} from 'react'

function App() {
    const [data, setData] = useState({})

    useEffect(() => {
      fetch("/"
      // {
        // headers : { 
        //   // 'Accept': 'application/json',
        //   // "Content-Type": "application/json",
        //  }
      // }
      ).then(
          res => {
            res.text()
          }
      ).then(
          data => {
            setData(data)
            console.log(data)
          }
      )
    }, [])

    return (
        <div>
            {(typeof data.cows === 'undefined')? (
                <p> Loading ... </p>
            ) : (
                data.cows.map((member, i) => (
                    <p key={i}>{member}</p>
                )) 
            )}


        </div>
    )
}

export default App
